function makePDF(id,name,lastname,email, projectheader, projectdescription, projectstructure) {

    var imgData = 'data:image/jpeg;base64,';

    var doc = new jsPDF();
    doc.setFontSize(10);
    doc.setFontType("bold");
    doc.text(10, 20, 'Hogeschool West-Vlaanderen');
    doc.text(10, 25, 'Howest Brugge');
    doc.text(10, 30, 'Rijselstraat 5 - 8200 Brugge')
    doc.text(10, 35, 'Tel: 050 38 12 77 - Fax : 050 38 11 71');
    doc.text(10, 40, 'Brugge@howest.be - website: www.howest.be');

    doc.addImage(imgData, 'JPEG', 120, 8, 80, 40);

    doc.setLineWidth(0.1);
    doc.line(10, 50, 200, 50);

    doc.text(20, 60, name + ' ' + lastname);
    doc.setFontType('normal');
    doc.text(20, 65, email);

    doc.setFontType('bold');
    doc.text(10, 80, projectheader + ' - ' + projectdescription);
    doc.text(10, 85, 'Toegepaste Architectuur - 3BA Toegepaste Architectuur');

    doc.text(10, 100, 'Competencies');
    doc.text(100, 100, 'Gewicht');
    doc.text(125, 100, 'Score');
    doc.text(150, 100, 'Opmerking');
    doc.line(10, 101, 180, 101);

    /*projectstructure.forEach(function(element, index, array)
    {

    });*/

    doc.setFontType('bold');
    doc.text(10, 110, 'Grafisch Presenteren');
    doc.text(100, 110, '25%');
    doc.text(128, 110, '50');
    doc.setFontType('normal');
    doc.text(20, 115, 'Lay-out opmaken');
    doc.text(100, 115, '100%');
    doc.text(128, 115, '40');
    doc.text(30, 120, 'Leesbaarheid van knooppunten');
    doc.text(100, 120, '50%');
    doc.text(128, 120, '50');
    doc.text(30, 125, 'Grafische kwaliteit tekst');
    doc.text(100, 125, '25%');
    doc.text(128, 125, '50');
    doc.text(30, 130, 'Grafische kwaliteit plan');
    doc.text(100, 130, '25%');
    doc.text(128, 130, '50');

    doc.save(name + '_' + lastname + '.pdf');
}